import React from 'react';
import Slider from 'react-slick';

const Carrousel = () => {

    const settings = {
        dots: false,
        infinite: true,
        autoplay: true,
        speed:500
    }

    return (
        <div
            className="carrousel_wrapper "
            style={{
                background:'red',
                height:`${window.innerHeight}px`,
                overflow:'hidden'
            }}
        >
            <Slider {...settings}>
                <div>
                    image1
                </div>
                <div>
                    image2
                </div>
                <div>
                    image3
                </div>
            </Slider>
        </div>
    );
};

export default Carrousel;
